import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';


function App() {


  const sisu = data.map(it => {
    return (
      <div>
        {data.map((item, index) => (
          <MainContent
            key={index}
            name={item.name}
            text={item.text}
            date={item.date}
            img={item.img}
            data={item}
          />
        ))}
      </div>
    )
  })


  return (
    <div className="App">
      {sisu}


    </div>
  );
}

export default App;
